/*Table structure for table `jadwal` */

DROP TABLE IF EXISTS `jadwal`;

CREATE TABLE `jadwal` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `setting_jadwal_id` int(10) DEFAULT NULL,
  `keterangan` varchar(255) DEFAULT NULL,
  `level` int(11) DEFAULT '0',
  `uraian` varchar(255) DEFAULT NULL,
  `aset_id` int(11) DEFAULT NULL,
  `jan_1` varchar(255) DEFAULT NULL COMMENT 'Kode;Warna;tanggal',
  `jan_2` varchar(255) DEFAULT NULL,
  `jan_3` varchar(255) DEFAULT NULL,
  `jan_4` varchar(255) DEFAULT NULL,
  `feb_1` varchar(255) DEFAULT NULL,
  `feb_2` varchar(255) DEFAULT NULL,
  `feb_3` varchar(255) DEFAULT NULL,
  `feb_4` varchar(255) DEFAULT NULL,
  `mar_1` varchar(255) DEFAULT NULL,
  `mar_2` varchar(255) DEFAULT NULL,
  `mar_3` varchar(255) DEFAULT NULL,
  `mar_4` varchar(255) DEFAULT NULL,
  `apr_1` varchar(255) DEFAULT NULL,
  `apr_2` varchar(255) DEFAULT NULL,
  `apr_3` varchar(255) DEFAULT NULL,
  `apr_4` varchar(255) DEFAULT NULL,
  `may_1` varchar(255) DEFAULT NULL,
  `may_2` varchar(255) DEFAULT NULL,
  `may_3` varchar(255) DEFAULT NULL,
  `may_4` varchar(255) DEFAULT NULL,
  `jun_1` varchar(255) DEFAULT NULL,
  `jun_2` varchar(255) DEFAULT NULL,
  `jun_3` varchar(255) DEFAULT NULL,
  `jun_4` varchar(255) DEFAULT NULL,
  `jul_1` varchar(255) DEFAULT NULL,
  `jul_2` varchar(255) DEFAULT NULL,
  `jul_3` varchar(255) DEFAULT NULL,
  `jul_4` varchar(255) DEFAULT NULL,
  `aug_1` varchar(255) DEFAULT NULL,
  `aug_2` varchar(255) DEFAULT NULL,
  `aug_3` varchar(255) DEFAULT NULL,
  `aug_4` varchar(255) DEFAULT NULL,
  `sep_1` varchar(255) DEFAULT NULL,
  `sep_2` varchar(255) DEFAULT NULL,
  `sep_3` varchar(255) DEFAULT NULL,
  `sep_4` varchar(255) DEFAULT NULL,
  `oct_1` varchar(255) DEFAULT NULL,
  `oct_2` varchar(255) DEFAULT NULL,
  `oct_3` varchar(255) DEFAULT NULL,
  `oct_4` varchar(255) DEFAULT NULL,
  `nov_1` varchar(255) DEFAULT NULL,
  `nov_2` varchar(255) DEFAULT NULL,
  `nov_3` varchar(255) DEFAULT NULL,
  `nov_4` varchar(255) DEFAULT NULL,
  `dec_1` varchar(255) DEFAULT NULL,
  `dec_2` varchar(255) DEFAULT NULL,
  `dec_3` varchar(255) DEFAULT NULL,
  `dec_4` varchar(255) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `nama_aset` varchar(255) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `id_ket` int(11) DEFAULT NULL,
  `wilayah_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
