/*Table structure for table `listrik` */

DROP TABLE IF EXISTS `listrik`;

CREATE TABLE `listrik` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `tahun` int(11) DEFAULT NULL,
  `period` varchar(10) DEFAULT NULL,
  `aset_id` int(11) DEFAULT NULL,
  `pemakaian` double DEFAULT '0',
  `rupiah` double DEFAULT '0',
  `foto_before` varchar(255) DEFAULT NULL,
  `foto_after` varchar(255) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=92 DEFAULT CHARSET=latin1;

